css:
atom-text-editor {
  font-kerning: none !important;
  -webkit-font-smoothing: antialiased !important;
  -moz-osx-font-smoothing: grayscale !important;
  -moz-font-smoothing: grayscale !important;
  text-rendering: optimizeLegibility !important;
}
atom-text-editor * {
  font-kerning: none !important;
  -webkit-font-smoothing: antialiased !important;
  -moz-osx-font-smoothing: grayscale !important;
  -moz-font-smoothing: grayscale !important;
  text-rendering: optimizeLegibility !important;
}
atom-text-editor .syntax--comment {
  font-style: normal !important;
}
atom-text-editor .syntax--hyperlink {
  text-decoration: none !important;
}
atom-text-editor .cursor {
  border-color: lime !important;
}
atom-text-editor .cursors {
  opacity: 1 !important;
}
atom-text-editor .cursors.blink-off {
  opacity: 0 !important;
}
atom-text-editor .bracket-matcher .region {
  opacity: 1 !important;
  border-bottom-color: lime !important;
  border-bottom-style: solid !important;
}
.status-bar .github-StatusBarTile,
.status-bar .line-ending-tile {
  display: none !important;
}
.tool-bar .btn {
  min-width: 2% !important;
  height: auto !important;
  min-height: auto !important;
  line-height: normal !important;
  border: none !important;
  background: transparent !important;
  border-radius: 0 !important;
  margin-top: 0 !important;
  margin-right: 0 !important;
  margin-bottom: 0 !important;
  margin-left: 0 !important;
  vertical-align: middle !important;
}
.tool-bar .btn:before {
  font-weight: normal !important;
  font-kerning: none !important;
  -webkit-font-smoothing: antialiased !important;
  -moz-osx-font-smoothing: grayscale !important;
  -moz-font-smoothing: grayscale !important;
  text-rendering: optimizeLegibility !important;
  height: 48px !important;
  line-height: 48px !important;
  vertical-align: middle !important;
}
.tool-bar .tool-bar-spacer {
  height: auto !important;
  border-image: none !important;
  vertical-align: middle !important;
}
.tool-bar .gc {
  font-family: "boxicons", "Material-Design-Icons" !important;
