.snippet-label {
  font-family: "Menlo-Regular", "MicrosoftSansSerif", "san-serif", "boxicons", "Material-Design-Icons", "mastericons" !important;
  font-style: normal !important;
  font-weight: bold !important;
  font-kerning: none !important;
  -webkit-font-smoothing: antialiased !important;
  -moz-osx-font-smoothing: grayscale !important;
  -moz-font-smoothing: grayscale !important;
  text-rendering: optimizeLegibility !important;
  vertical-align: middle !important;
  display: block !important;
}
.snippet-label.primary {
  color: #61afef !important;
}
.snippet-label.secondary {
  color: #828997 !important;
}
.snippet-label.success {
  color: #98c379 !important;
}
.snippet-label.info {
  color: #61afef !important;
}
.snippet-label.warning {
  color: #e5c07b !important;
}
.snippet-label.danger {
  color: #d6666f !important;
}
.snippet-label.light {
  color: #abb2bf !important;
}
.snippet-label.dark {
  color: #5c6370 !important;
}
.snippet-label.bi {
  font-size: 1.875em !important;
  font-weight: normal !important;
  line-height: 12px !important;
  padding-top: 6px !important;
}
.ftp-remote-edit-queue {
  border-top: none !important;
  border-bottom: none !important;
}
.ftp-remote-edit-queue.tool-panel.panel-bottom .list {
  color: #282c34 !important;
  background-color: #c678dd !important;
}
.ftp-remote-edit-queue.tool-panel.panel-bottom .list li {
  padding-top: 0 !important;
  padding-bottom: 0 !important;
  height: 36px !important;
  line-height: 36px !important;
  font-size: 1em !important;
  font-kerning: none !important;
  -webkit-font-smoothing: antialiased !important;
  -moz-osx-font-smoothing: grayscale !important;
  -moz-font-smoothing: grayscale !important;
  text-rendering: optimizeLegibility !important;
}
